import React, { useEffect } from "react";
import { Col, Container, Nav, Row, Table } from "react-bootstrap";
import Chart from "chart.js";
import { Route, Switch, useRouteMatch } from "react-router";
import { Link } from "react-router-dom";
import DashboardSummary from "../components/DashboardSummary";
import Sales from "../components/Sales";
// import styles from "./AdminDashboard.module.css";

export default function AdminDashboard() {
  let match = useRouteMatch();

  return (
    <Container fluid className="mt-3 mb-5">
      <Row xs={1} md={2}>
        <Col lg={1}>
          <Nav defaultActiveKey="/" className="flex-column">
            <h6>Dashboard Nav</h6>
            <Nav.Link as={Link} to={`${match.url}`}>
              Summary
            </Nav.Link>
            <Nav.Link as={Link} to={`${match.url}/sales`}>
              Sales
            </Nav.Link>
            <Nav.Link eventKey="link-2">Customers</Nav.Link>
            <Nav.Link eventKey="link-2">Inventory</Nav.Link>
            <Nav.Link eventKey="disabled" disabled>
              Disabled
            </Nav.Link>
          </Nav>
        </Col>
        <Col lg={11}>
          <Switch>
            <Route path={`${match.path}`} exact component={DashboardSummary} />
            <Route path={`${match.path}/sales`} component={Sales} />
          </Switch>
        </Col>
      </Row>
    </Container>
  );
}
